import React from 'react';
import { NavLink} from 'react-router-dom';
const Header = () => {
    
    return (
        <div >
                <NavLink to="/users" >Users</NavLink>&nbsp;&nbsp;          
                <NavLink to="/enterprises">Enterprises</NavLink>&nbsp;&nbsp;
                  <NavLink to="/contactUs">Contact Us</NavLink>&nbsp;
              
  
        </div>
        //         <div>
        //             לוגו
        //             אידר משני
        // </div>
    )
}
export default Header;
